(def burnin-vs-probs
  (let [vc 9]
    (sort-by 
      first
      (map (fn [e w b] [(get-in e [:exp-params :training-params :stdp_burnin]) 
                    (map #(f/prob-visi (create-theoretical-rbm w (vec (take vc b)) (vec (drop vc b))) %) bars)])
         exps weights biases))))
